import React from "react";
import Navigation from "../../components/Navigation";
import Footer from "../../components/Footer";

const Detail = () => {
    return (
        <>
            <Navigation />
            <section className="container mx-auto px-4 mt-7 space-y-10">ini detail</section>
            <Footer />
        </>
    );
};

export default Detail;
